  false,\n\t\"url\": null,\n\t\"notes\": \"This data comes from a survey conducted
  by the New Orleans Crime Coalition's Citizen Satisfaction Survey. The survey sample
  includes 600 New Orleans residents, 75 from each police distract. The data has a
